    const history = useHistory();
    return (
        <div>
            <HomeButton />
            <hr/>
            <h5>We're sorry, but we could not find the pet you are looking for. Would you like to add this pet to our database?</h5>

            <Link to={"/new"}>
                Create Pet
            </Link>
        </div>
    )
}


